import React from 'react';

export default function PlaceHolder(){
    return(
        <div className="placeholder">
            <h2> News Section</h2>
            <ul className='placeholder__list'>
                <li className="placeholder__link">Item 1</li>
                <li className="placeholder__link">Item 2</li>
                <li className="placeholder__link">Item 3</li>
                <li className="placeholder__link">Item 4</li>
                <li className="placeholder__link">Item 5</li>
            </ul>
        </div>
    )
}
